    return(
        <div className="contact-body">
             <big className="section-header">Interest keeping contact with me?</big>
             <h1>Let keep in touch!</h1>
             <h2>pro10150@gmail.com | +66967188041</h2>
             <a href="https://www.linkedin.com/in/noppakun-anantakitthawon-67b96a183/"><img src="src/assets/images/LinkedIn_icon.png" alt="Linkedin logo" /></a>
        </div>
    )
}

export default Contact
